class BolaReport{showConfig(n,t,i){const r=$("#configModal");$.ajax({method:"GET",url:"/bolareport/config?currency="+n+"&stake="+t+"&tableIndex="+i}).done(function(n){n&&(r.find("#editdetails").html(n),r.modal("show"))})}showEnableDisable(n,t){let r=!(n=="True"),u=r?"Enable":"Disable";const i=$("#enableModal");i.find("#enableParam").val(r);i.find("#tableIndexParam").val(t);i.find("#reloadContent").html(`Are you sure you want ${u} Table Index ${t}`);i.modal("show")}submitEnableDisable(){const n=$("#enableModal");let t=n.find("#enableParam").val(),i=parseInt(n.find("#tableIndexParam").val());n.find("#confirmBtn").prop("disabled",!0);$.ajax({method:"POST",url:"/bolareport/enabledisable?enabled="+t+"&tableIndex="+i}).done(function(t){t?n.find("#updateMsgSuccess").show():n.find("#updateMsgFailed").show();setTimeout(function(){n.find("#confirmBtn").prop("disabled",!1);n.find("#updateMsgSuccess").hide();n.find("#updateMsgFailed").hide();n.modal("hide")},1e3)})}cancelEnableDisable(){const n=$("#enableModal");n.modal("hide");bolaReport.loadReport()}loadReport(){const n=$("#bolaReportForm");n.submit()}}var bolaReport=new BolaReport;stickHeader.stick(".inner-content","table#report-table",120,-20);$(document).ready(function(){});